import styled from 'styled-components';

const Work = () => (
    <WorkContainer>
        <Project>
            <ProjectTitle>Dev Tracker</ProjectTitle>
            <ProjectDescription>Dev Tracker is a web application that we built for Dev Point Labs that allows students to log in and track current applications, interviews, and phone calls for companies they are interested in.</ProjectDescription>
        </Project>
        <Project>

        </Project>
        <Project>

        </Project>
    </WorkContainer>

)

const WorkContainer = styled.div`
    display: grid;
    grid-template-columns: 1fr;
    grid-gap: 1em;
    height: 100%;
    min-height: 100vh;
    padding: 100px 2em;
    max-width: 600px;
    width: 100%;
    margin: 0 auto;
`;

const Project = styled.div`

`;

const ProjectTitle = styled.h3`

`;

const ProjectDescription = styled.p`

`;

export default Work;
